import React from 'react';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

function PerformanceChart({ data }) {
    // Veriyi ReCharts için uygun formata dönüştür
    const chartData = [
        {
            name: 'Çalışma Süresi (sn)',
            'Sıralı Algoritma': data.sequential.time,
            'Temel Paralel': data.parallel.time,
            'Geliştirilmiş Paralel': data.improved.time,
            'Strassen Algoritması': data.blocked.time
        },
        {
            name: 'Hızlanma (Speedup)',
            'Sıralı Algoritma': data.sequential.speedup,
            'Temel Paralel': data.parallel.speedup,
            'Geliştirilmiş Paralel': data.improved.speedup,
            'Strassen Algoritması': data.blocked.speedup
        }
    ];

    return (
        <div className="chart-wrapper">
            <h5 className="text-center mb-3">Çalışma Süresi Karşılaştırması</h5>
            <ResponsiveContainer width="100%" height={300}>
                <BarChart
                    data={[chartData[0]]}
                    margin={{
                        top: 5,
                        right: 30,
                        left: 20,
                        bottom: 5,
                    }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis />
                    <Tooltip formatter={(value) => value.toFixed(6)} />
                    <Legend />
                    <Bar dataKey="Sıralı Algoritma" fill="#6c757d" />
                    <Bar dataKey="Temel Paralel" fill="#0d6efd" />
                    <Bar dataKey="Geliştirilmiş Paralel" fill="#198754" />
                    <Bar dataKey="Strassen Algoritması" fill="#dc3545" />
                </BarChart>
            </ResponsiveContainer>

            <h5 className="text-center mb-3 mt-5">Hızlanma (Speedup) Karşılaştırması</h5>
            <ResponsiveContainer width="100%" height={300}>
                <BarChart
                    data={[chartData[1]]}
                    margin={{
                        top: 5,
                        right: 30,
                        left: 20,
                        bottom: 5,
                    }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis dataKey="name" />
                    <YAxis />
                    <Tooltip formatter={(value) => value.toFixed(2)} />
                    <Legend />
                    <Bar dataKey="Sıralı Algoritma" fill="#6c757d" />
                    <Bar dataKey="Temel Paralel" fill="#0d6efd" />
                    <Bar dataKey="Geliştirilmiş Paralel" fill="#198754" />
                    <Bar dataKey="Strassen Algoritması" fill="#dc3545" />
                </BarChart>
            </ResponsiveContainer>
        </div>
    );
}

export default PerformanceChart;
